import React from 'react'
import logo from '../assets/images/logo.svg'
import main from '../assets/images/main.svg'

const Landing = () => {
  return (
    <main>
        <nav>
            <img src={logo} alt='jobi' className='logo' />
        </nav>
        

    </main>
  )
}

export default Landing
